import React from 'react'
import styles from './Victory.module.css'
import { VictoryBar, VictoryChart, VictoryLine, VictoryTooltip } from 'victory';
import { DataInputProps } from '../../App';

const data = [
    { quarter: 1, earnings: 13000 },
    { quarter: 2, earnings: 16500 },
    { quarter: 3, earnings: 14250 },
    { quarter: 4, earnings: 19000 }
];

interface VictoryProps {
    data: DataInputProps[]
}

const Victory = (props: VictoryProps) => {

    const houseMedianAgeChartsData = props.data?.map((record, index) => {
        return ({
            name: "",
            uv: record['housing_median_age'] ?? 0
        });
    }) ?? [{ name: "", uv: 0 }];
    const totalBedroomsChartsData = props.data?.map((record, index) => {
        return ({
            name: "",
            uv: record['total_bedrooms'] ?? 0
        });
    }) ?? [{ name: "", uv: 0 }];
    const medianIncomeChartsData = props.data?.map((record, index) => {
        return ({
            name: "",
            uv: record['median_income'] ?? 0
        });
    }) ?? [{ name: "", uv: 0 }];

    const medianHouseValueChartsData = props.data?.map((record, index) => {
        return ({
            name: "",
            value: record['median_house_value'] ?? 0,
            rooms: record['total_rooms'] ?? 0
        });
    }) ?? [{ name: "", value: 0, rooms: 0}];

    return (
        <div style={{width: "50%"}}>
            <VictoryChart domainPadding={10}>
                <VictoryBar
                barRatio={0.5}
                    labels={({ datum }) => datum.value}
                    labelComponent={<VictoryTooltip/>}
                    //data={houseMedianAgeChartsData.slice(0, 100)}
                    data={medianHouseValueChartsData.slice(100, 130)}
                    // data accessor for x values
                    x="rooms"
                    y="value"
                    // data accessor for y values
                    //y="name"
                />
            </VictoryChart>
            <VictoryChart domainPadding={30}>
                <VictoryLine
                    style={{
                        data: { stroke: "blue" },
                        parent: { border: "1px solid #ccc"}
                      }}
                      interpolation="natural"
                    //data={houseMedianAgeChartsData.slice(0, 100)}
                    data={houseMedianAgeChartsData.slice(0, 100)}
                    // data accessor for x values
                    y="uv"
                    // data accessor for y values
                    //y="name"
                />
            </VictoryChart>
        </div>


    )
}

export default Victory
